  return (
    <div className="App">
      <Header />
      <div className="wrapper">
        <Sidebar data={response} />
        <Dashboard data={response} />
      </div>
    </div>
  );
}
const mapStateToProps = state => {
  return {
    response: state.response
  };
};

export default connect(
  mapStateToProps,
  { fetchData }
)(App);
